            return peeked = com.google.gson.stream.JsonReader.PEEKED_BEGIN_ARRAY;
        case '{' :
            return peeked = com.google.gson.stream.JsonReader.PEEKED_BEGIN_OBJECT;
        default :
            pos--;
    }
    if (stackSize == 1) {
        checkLenient();
    }
    int result = peekKeyword();
    if (result != com.google.gson.stream.JsonReader.PEEKED_NONE) {
        return result;
    }
    result = peekNumber();
    if (result != com.google.gson.stream.JsonReader.PEEKED_NONE) {
        return result;
    }
    if (!isLiteral(buffer[pos])) {
        throw syntaxError("Expected value");
    }
    checkLenient();
    return peeked = com.google.gson.stream.JsonReader.PEEKED_UNQUOTED;
}
